import logo from './logo.svg';
import './App.css';
import {Header} from './Header'
import {Footer} from 'Footer';
import {Content} from 'Content';
import {Import} from './import';

function App() {
  return (
    <div className='App'>

      <div class="header">
       <Header></Header>
      </div>

      <div class="Main">
        <Content></Content>
      </div>

      <div class="footer">
        <Footer></Footer>
      </div>
    </div>
  );
}

export default App;
